import { BrowserRouter, Route, Switch } from 'react-router-dom';

import './App.css';
import HomePage from './pages/HomePage';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path='/' component={HomePage} />
        {/* <Route path='/detail/:id' component={DetailPage} />
        <Route path='/cart' component={DetailPage} /> */}
      </Switch>
    </BrowserRouter>
  );
}

export default App;
